import React, { useState, useEffect } from 'react';
import {
  Container,
  Paper,
  Typography,
  Box,
  Grid,
  Card,
  CardContent,
  Button,
  Avatar,
  List,
  ListItem,
  ListItemText,
  ListItemIcon,
  Divider,
  Alert,
  CircularProgress,
  AppBar,
  Toolbar,
  IconButton,
  Menu,
  MenuItem,
} from '@mui/material';
import {
  AdminPanelSettings,
  People,
  Store,
  ShoppingCart,
  Assessment,
  TrendingUp,
  AttachMoney,
  Logout,
  Restaurant,
  Person,
  ArrowBack,
  Home,
  AccountCircle,
} from '@mui/icons-material';

const SimpleAdminDashboard = () => {
  const [adminData, setAdminData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [currentView, setCurrentView] = useState('dashboard'); // dashboard, users, vendors, analytics, settings
  const [anchorEl, setAnchorEl] = useState(null);

  // Admin data states
  const [users, setUsers] = useState([]);
  const [vendors, setVendors] = useState([]);
  const [products, setProducts] = useState([]);
  const [orders, setOrders] = useState([]);
  const [stats, setStats] = useState({
    totalUsers: 0,
    totalVendors: 0,
    totalProducts: 0,
    totalOrders: 0,
    totalRevenue: 0
  });

  // Real-time activity tracking states
  const [recentActivities, setRecentActivities] = useState([]);
  const [systemStatus, setSystemStatus] = useState({
    activeUsers: 0,
    onlineUsers: 0,
    totalSessions: 0,
    serverLoad: 45,
    uptime: '99.8%',
    lastBackup: new Date().toLocaleString(),
    systemVersion: 'v2.1.0'
  });
  const [userSessions, setUserSessions] = useState([]);

  useEffect(() => {
    // Get admin data from localStorage
    const user = localStorage.getItem('user');
    const token = localStorage.getItem('token');

    if (!user || !token) {
      setError('Please login first');
      setLoading(false);
      return;
    }

    try {
      const parsedUser = JSON.parse(user);
      if (parsedUser.role !== 'ADMIN') {
        setError('Access denied. Admin role required.');
        setLoading(false);
        return;
      }
      setAdminData(parsedUser);

      // Load admin data
      loadAdminData();
    } catch (err) {
      setError('Error loading user data');
      setLoading(false);
    }
  }, []);

  // Load admin dashboard data
  const loadAdminData = async () => {
    try {
      // Load data from localStorage (since backend might not be available)
      const allVendorProducts = JSON.parse(localStorage.getItem('allVendorProducts') || '{}');
      const allUsers = JSON.parse(localStorage.getItem('allUsers') || '[]');

      // Extract products
      let allProducts = [];
      Object.keys(allVendorProducts).forEach(vendorKey => {
        if (allVendorProducts[vendorKey]) {
          allProducts = [...allProducts, ...allVendorProducts[vendorKey]];
        }
      });

      // Extract vendors from both registered users and product data
      const registeredVendors = allUsers.filter(user => user.role === 'VENDOR');
      const productVendors = [...new Set(allProducts.map(p => p.vendor))];

      // Combine and deduplicate vendors
      const allVendorsList = [...new Set([...registeredVendors.map(v => v.businessName || v.shopName || v.name), ...productVendors])]
        .filter(vendorName => vendorName && vendorName !== 'Restaurant One')
        .map(vendorName => {
          const registeredVendor = registeredVendors.find(v => 
            (v.businessName || v.shopName || v.name) === vendorName
          );
          const vendorProducts = allProducts.filter(p => p.vendor === vendorName);

          return {
            name: vendorName,
            productCount: vendorProducts.length,
            email: registeredVendor?.email || 'N/A',
            phone: registeredVendor?.phone || 'N/A',
            businessType: registeredVendor?.businessType || 'N/A',
            address: registeredVendor?.address || 'N/A',
            registeredAt: registeredVendor?.createdAt || 'N/A',
            isRegistered: !!registeredVendor
          };
        });

      // Calculate stats
      const calculatedStats = {
        totalUsers: allUsers.length || 0,
        totalVendors: allVendorsList.length,
        totalProducts: allProducts.length,
        totalOrders: 0, // Will be implemented when orders are stored
        totalRevenue: allProducts.reduce((sum, p) => sum + (p.price || 0), 0)
      };

      // Load recent activities
      loadRecentActivities(allProducts, allUsers, allVendorsList);

      // Load user sessions and system status
      loadUserSessions(allUsers);
      updateSystemStatus();

      setUsers(allUsers);
      setVendors(allVendorsList);
      setProducts(allProducts);
      setOrders([]); // Will be implemented
      setStats(calculatedStats);
      setLoading(false);

    } catch (error) {
      console.error('Error loading admin data:', error);
      setError('Failed to load admin data');
      setLoading(false);
    }
  };

  // Load recent activities
  const loadRecentActivities = (products, users, vendors) => {
    const activities = [];
    const now = new Date();

    // Simulate recent vendor registrations
    vendors.forEach((vendor, index) => {
      activities.push({
        type: 'vendor_registration',
        title: `New Vendor Registration`,
        description: `${vendor.name} applied for vendor account`,
        time: `${index * 5 + 1} mins ago`,
        icon: 'Store',
        color: 'success'
      });
    });

    // Simulate recent product additions
    products.slice(-3).forEach((product, index) => {
      activities.push({
        type: 'product_added',
        title: `New Product Added`,
        description: `${product.name} added by ${product.vendor}`,
        time: `${index * 10 + 2} mins ago`,
        icon: 'ShoppingCart',
        color: 'info'
      });
    });

    // Simulate user registrations
    users.slice(-2).forEach((user, index) => {
      activities.push({
        type: 'user_registration',
        title: `New User Registration`,
        description: `${user.name || 'User'} joined the platform`,
        time: `${index * 15 + 3} mins ago`,
        icon: 'Person',
        color: 'primary'
      });
    });

    // Add system activities
    activities.push({
      type: 'system_update',
      title: `System Update`,
      description: `Database backup completed successfully`,
      time: '1 hour ago',
      icon: 'SystemUpdate',
      color: 'warning'
    });

    setRecentActivities(activities.slice(0, 8)); // Show latest 8 activities
  };

  // Load user sessions
  const loadUserSessions = (users) => {
    const sessions = users.map((user, index) => ({
      id: user.id || index,
      name: user.name || `User ${index + 1}`,
      email: user.email || `user${index + 1}@test.com`,
      status: Math.random() > 0.3 ? 'online' : 'offline', // Simulate online/offline
      lastActivity: Math.random() > 0.5 ? 'Active now' : `${Math.floor(Math.random() * 60)} mins ago`,
      sessionDuration: `${Math.floor(Math.random() * 120) + 10} mins`,
      role: user.role || 'USER'
    }));

    setUserSessions(sessions);

    // Update system status
    const onlineCount = sessions.filter(s => s.status === 'online').length;
    const activeCount = sessions.filter(s => s.lastActivity === 'Active now').length;

    setSystemStatus(prev => ({
      ...prev,
      onlineUsers: onlineCount,
      activeUsers: activeCount,
      totalSessions: sessions.length
    }));
  };

  // Update system status
  const updateSystemStatus = () => {
    setSystemStatus(prev => ({
      ...prev,
      serverLoad: Math.floor(Math.random() * 30) + 30, // Simulate 30-60% load
      lastBackup: new Date(Date.now() - Math.random() * 7200000).toLocaleString() // Random time within last 2 hours
    }));
  };

  // Add new activity (to be called from other components)
  const addActivity = (type, title, description) => {
    const newActivity = {
      type,
      title,
      description,
      time: 'Just now',
      icon: type === 'user_registration' ? 'Person' : 
            type === 'vendor_registration' ? 'Store' : 
            type === 'product_added' ? 'ShoppingCart' : 'Notification',
      color: type === 'user_registration' ? 'primary' : 
             type === 'vendor_registration' ? 'success' : 
             type === 'product_added' ? 'info' : 'warning'
    };

    setRecentActivities(prev => [newActivity, ...prev].slice(0, 8));
  };

  // Listen for real-time updates from other dashboards
  useEffect(() => {
    const handleMessage = (event) => {
      if (event.data && event.data.type) {
        console.log('Admin Dashboard received message:', event.data);

        switch (event.data.type) {
          case 'PRODUCT_ADDED':
            addActivity('product_added', 'New Product Added', 
              `${event.data.product.name} added by ${event.data.product.vendor}`);
            loadAdminData(); // Refresh data
            break;
          case 'USER_LOGIN':
            addActivity('user_login', 'User Login', 
              `${event.data.userName} logged into the system`);
            loadAdminData(); // Refresh data
            break;
          case 'VENDOR_REGISTERED':
            addActivity('vendor_registration', 'New Vendor Registration', 
              `${event.data.vendorName} applied for vendor account`);
            loadAdminData(); // Refresh data
            break;
        }
      }
    };

    window.addEventListener('message', handleMessage);
    return () => window.removeEventListener('message', handleMessage);
  }, []);

  // Auto-refresh system status every 30 seconds
  useEffect(() => {
    const interval = setInterval(() => {
      updateSystemStatus();
      loadUserSessions(users);
    }, 30000);

    return () => clearInterval(interval);
  }, [users]);

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    window.location.href = '/login';
  };

  // Navigation Functions
  const handleBackToDashboard = () => {
    setCurrentView('dashboard');
  };

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const getViewTitle = () => {
    switch(currentView) {
      case 'dashboard': return 'Admin Dashboard';
      case 'users': return 'User Management';
      case 'vendors': return 'Vendor Management';
      case 'analytics': return 'Platform Analytics';
      case 'settings': return 'System Settings';
      default: return 'Admin Dashboard';
    }
  };

  const handleViewUsers = () => {
    setCurrentView('users');
  };

  const handleViewVendors = () => {
    setCurrentView('vendors');
  };

  const handleViewAnalytics = () => {
    setCurrentView('analytics');
  };

  const handleViewSettings = () => {
    setCurrentView('settings');
  };

  // Admin Management Functions
  const handleDeleteUser = (userId) => {
    if (window.confirm('Are you sure you want to delete this user?')) {
      const updatedUsers = users.filter(user => user.id !== userId);
      setUsers(updatedUsers);
      localStorage.setItem('allUsers', JSON.stringify(updatedUsers));
      alert('User deleted successfully');
    }
  };

  const handleDeleteVendor = (vendorName) => {
    if (window.confirm(`Are you sure you want to delete ${vendorName} and all their products?`)) {
      // Remove vendor products from localStorage
      const allVendorProducts = JSON.parse(localStorage.getItem('allVendorProducts') || '{}');
      Object.keys(allVendorProducts).forEach(vendorKey => {
        if (allVendorProducts[vendorKey] && allVendorProducts[vendorKey][0]?.vendor === vendorName) {
          delete allVendorProducts[vendorKey];
        }
      });
      localStorage.setItem('allVendorProducts', JSON.stringify(allVendorProducts));

      // Reload data
      loadAdminData();
      alert(`Vendor ${vendorName} and their products deleted successfully`);
    }
  };

  const handleDeleteProduct = (productId) => {
    if (window.confirm('Are you sure you want to delete this product?')) {
      // Remove product from localStorage
      const allVendorProducts = JSON.parse(localStorage.getItem('allVendorProducts') || '{}');
      Object.keys(allVendorProducts).forEach(vendorKey => {
        if (allVendorProducts[vendorKey]) {
          allVendorProducts[vendorKey] = allVendorProducts[vendorKey].filter(p => p.id !== productId);
        }
      });
      localStorage.setItem('allVendorProducts', JSON.stringify(allVendorProducts));

      // Reload data
      loadAdminData();
      alert('Product deleted successfully');
    }
  };

  const handleRefreshData = () => {
    setLoading(true);
    loadAdminData();
  };

  if (loading) {
    return (
      <Container maxWidth="lg" sx={{ py: 4 }}>
        <Box display="flex" justifyContent="center" alignItems="center" minHeight="400px">
          <CircularProgress size={60} />
        </Box>
      </Container>
    );
  }

  if (error) {
    return (
      <Container maxWidth="lg" sx={{ py: 4 }}>
        <Alert severity="error">{error}</Alert>
        <Button
          variant="contained"
          onClick={() => window.location.href = '/login'}
          sx={{ mt: 2 }}
        >
          Go to Login
        </Button>
      </Container>
    );
  }

  return (
    <Box sx={{ flexGrow: 1 }}>
      {/* Navbar */}
      <AppBar position="static" sx={{ mb: 3 }}>
        <Toolbar>
          {currentView !== 'dashboard' && (
            <IconButton
              edge="start"
              color="inherit"
              onClick={handleBackToDashboard}
              sx={{ mr: 2 }}
            >
              <ArrowBack />
            </IconButton>
          )}

          <Typography variant="h6" sx={{ flexGrow: 1 }}>
            {getViewTitle()}
          </Typography>

          <IconButton
            edge="end"
            color="inherit"
            onClick={handleMenuOpen}
          >
            <AccountCircle />
          </IconButton>

          <Menu
            anchorEl={anchorEl}
            open={Boolean(anchorEl)}
            onClose={handleMenuClose}
          >
            <MenuItem onClick={handleMenuClose}>
              <ListItemIcon><AdminPanelSettings /></ListItemIcon>
              <ListItemText>{adminData?.name || 'Administrator'}</ListItemText>
            </MenuItem>
            <MenuItem onClick={() => { handleMenuClose(); handleLogout(); }}>
              <ListItemIcon><Logout /></ListItemIcon>
              <ListItemText>Logout</ListItemText>
            </MenuItem>
          </Menu>
        </Toolbar>
      </AppBar>

      <Container maxWidth="lg" sx={{ py: 2 }}>
        {/* Dashboard View */}
        {currentView === 'dashboard' && (
          <>
            {/* Header */}
            <Box sx={{ mb: 4, display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
              <Box sx={{ display: 'flex', alignItems: 'center' }}>
                <Avatar sx={{ bgcolor: 'secondary.main', mr: 2 }}>
                  <AdminPanelSettings />
                </Avatar>
                <Box>
                  <Typography variant="h6" color="text.secondary">
                    Welcome, {adminData?.name || 'Administrator'}!
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Manage the entire platform efficiently
                  </Typography>
                </Box>
              </Box>
            </Box>

            {/* Stats Cards */}
            <Grid container spacing={3} sx={{ mb: 4 }}>
              <Grid item xs={12} sm={6} md={3}>
                <Card>
                  <CardContent>
                    <Box display="flex" alignItems="center">
                      <Avatar sx={{ bgcolor: 'success.main', mr: 2 }}>
                        <AttachMoney />
                      </Avatar>
                      <Box>
                        <Typography variant="h4" fontWeight="bold">
                          $45,280
                        </Typography>
                        <Typography color="text.secondary">
                          Total Revenue
                        </Typography>
                      </Box>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>

              <Grid item xs={12} sm={6} md={3}>
                <Card>
                  <CardContent>
                    <Box display="flex" alignItems="center">
                      <Avatar sx={{ bgcolor: 'info.main', mr: 2 }}>
                        <People />
                      </Avatar>
                      <Box>
                        <Typography variant="h4" fontWeight="bold">
                          1,247
                        </Typography>
                        <Typography color="text.secondary">
                          Total Users
                        </Typography>
                      </Box>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>

              <Grid item xs={12} sm={6} md={3}>
                <Card>
                  <CardContent>
                    <Box display="flex" alignItems="center">
                      <Avatar sx={{ bgcolor: 'warning.main', mr: 2 }}>
                        <Store />
                      </Avatar>
                      <Box>
                        <Typography variant="h4" fontWeight="bold">
                          89
                        </Typography>
                        <Typography color="text.secondary">
                          Active Vendors
                        </Typography>
                      </Box>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>

              <Grid item xs={12} sm={6} md={3}>
                <Card>
                  <CardContent>
                    <Box display="flex" alignItems="center">
                      <Avatar sx={{ bgcolor: 'primary.main', mr: 2 }}>
                        <ShoppingCart />
                      </Avatar>
                      <Box>
                        <Typography variant="h4" fontWeight="bold">
                          3,426
                        </Typography>
                        <Typography color="text.secondary">
                          Total Orders
                        </Typography>
                      </Box>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>
            </Grid>

            {/* Header */}
            <Box sx={{ mb: 4, display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
              <Box sx={{ display: 'flex', alignItems: 'center' }}>
                <Avatar sx={{ bgcolor: 'secondary.main', mr: 2 }}>
                  <AdminPanelSettings />
                </Avatar>
                <Box>
                  <Typography variant="h6" color="text.secondary">
                    Welcome, {adminData?.name || 'Administrator'}!
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Manage the entire platform efficiently
                  </Typography>
                </Box>
              </Box>
            </Box>

            {/* Stats Cards */}
            <Grid container spacing={3} sx={{ mb: 4 }}>
              <Grid item xs={12} sm={6} md={3}>
                <Card>
                  <CardContent>
                    <Box display="flex" alignItems="center">
                      <Avatar sx={{ bgcolor: 'success.main', mr: 2 }}>
                        <AttachMoney />
                      </Avatar>
                      <Box>
                        <Typography variant="h4" fontWeight="bold">
                          $45,280
                        </Typography>
                        <Typography color="text.secondary">
                          Total Revenue
                        </Typography>
                      </Box>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>

              <Grid item xs={12} sm={6} md={3}>
                <Card>
                  <CardContent>
                    <Box display="flex" alignItems="center">
                      <Avatar sx={{ bgcolor: 'info.main', mr: 2 }}>
                        <People />
                      </Avatar>
                      <Box>
                        <Typography variant="h4" fontWeight="bold">
                          1,247
                        </Typography>
                        <Typography color="text.secondary">
                          Total Users
                        </Typography>
                      </Box>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>

              <Grid item xs={12} sm={6} md={3}>
                <Card>
                  <CardContent>
                    <Box display="flex" alignItems="center">
                      <Avatar sx={{ bgcolor: 'warning.main', mr: 2 }}>
                        <Store />
                      </Avatar>
                      <Box>
                        <Typography variant="h4" fontWeight="bold">
                          89
                        </Typography>
                        <Typography color="text.secondary">
                          Active Vendors
                        </Typography>
                      </Box>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>

              <Grid item xs={12} sm={6} md={3}>
                <Card>
                  <CardContent>
                    <Box display="flex" alignItems="center">
                      <Avatar sx={{ bgcolor: 'primary.main', mr: 2 }}>
                        <ShoppingCart />
                      </Avatar>
                      <Box>
                        <Typography variant="h4" fontWeight="bold">
                          3,426
                        </Typography>
                        <Typography color="text.secondary">
                          Total Orders
                        </Typography>
                      </Box>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>
            </Grid>
              <Grid item xs={12} md={6}>
                <Paper sx={{ p: 3 }}>
                  <Typography variant="h6" fontWeight="bold" sx={{ mb: 3 }}>
                    Admin Controls
                  </Typography>
                  <List>
                    <ListItem 
                      button 
                      sx={{ borderRadius: 1, mb: 1 }}
                      onClick={handleViewUsers}
                    >
                      <ListItemIcon>
                        <People color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Manage Users" secondary="Manage all user accounts" />
                    </ListItem>
                    <ListItem 
                      button 
                      sx={{ borderRadius: 1, mb: 1 }}
                      onClick={handleViewVendors}
                    >
                      <ListItemIcon>
                        <Store color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Manage Vendors" secondary="Approve and manage vendors" />
                    </ListItem>
                    <ListItem 
                      button 
                      sx={{ borderRadius: 1, mb: 1 }}
                      onClick={handleViewAnalytics}
                    >
                      <ListItemIcon>
                        <Assessment color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="Monitor System Performance" secondary="View platform statistics" />
                    </ListItem>
                    <ListItem 
                      button 
                      sx={{ borderRadius: 1 }}
                      onClick={handleViewAnalytics}
                    >
                      <ListItemIcon>
                        <TrendingUp color="primary" />
                      </ListItemIcon>
                      <ListItemText primary="View Analytical Reports" secondary="Detailed system analytics" />
                    </ListItem>
                  </List>
                </Paper>
              </Grid>

              <Grid item xs={12} md={6}>
                <Paper sx={{ p: 3 }}>
                  <Typography variant="h6" fontWeight="bold" sx={{ mb: 3 }}>
                    Recent Activity
                  </Typography>
                  <List>
                    {recentActivities.length > 0 ? recentActivities.map((activity, index) => (
                      <ListItem key={index} sx={{ borderRadius: 1, mb: 1, bgcolor: 'grey.50' }}>
                        <ListItemIcon>
                          {activity.icon === 'Person' && <Person color={activity.color} />}
                          {activity.icon === 'Store' && <Store color={activity.color} />}
                          {activity.icon === 'ShoppingCart' && <ShoppingCart color={activity.color} />}
                          {activity.icon === 'SystemUpdate' && <Assessment color={activity.color} />}
                          {activity.icon === 'Notification' && <TrendingUp color={activity.color} />}
                        </ListItemIcon>
                        <ListItemText 
                          primary={activity.title}
                          secondary={`${activity.description} - ${activity.time}`}
                        />
                        <Box sx={{ 
                          width: 8, 
                          height: 8, 
                          borderRadius: '50%', 
                          bgcolor: activity.color === 'success' ? 'success.main' : 
                                     activity.color === 'info' ? 'info.main' : 
                                     activity.color === 'warning' ? 'warning.main' : 'primary.main'
                        }} />
                      </ListItem>
                    )) : (
                      <ListItem sx={{ borderRadius: 1, mb: 1, bgcolor: 'grey.50' }}>
                        <ListItemText primary="No recent activity" secondary="System is idle" />
                      </ListItem>
                    )}
                  </List>
                </Paper>
              </Grid>

            {/* System Status */}
            <Paper sx={{ p: 3 }}>
              <Typography variant="h6" fontWeight="bold" sx={{ mb: 3 }}>
                System Status & User Activity
              </Typography>

              {/* User Activity Overview */}
              <Grid container spacing={3} sx={{ mb: 3 }}>
                <Grid item xs={12} md={4}>
                  <Box sx={{ textAlign: 'center', p: 2, border: 1, borderColor: 'grey.200', borderRadius: 1 }}>
                    <Typography variant="h4" color="success.main" fontWeight="bold">
                      {systemStatus.onlineUsers}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Users Online
                    </Typography>
                    <Box sx={{ 
                      width: 12, 
                      height: 12, 
                      borderRadius: '50%', 
                      bgcolor: 'success.main', 
                      mx: 'auto', 
                      mt: 1 
                    }} />
                  </Box>
                </Grid>

                <Grid item xs={12} md={4}>
                  <Box sx={{ textAlign: 'center', p: 2, border: 1, borderColor: 'grey.200', borderRadius: 1 }}>
                    <Typography variant="h4" color="info.main" fontWeight="bold">
                      {systemStatus.activeUsers}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Active Now
                    </Typography>
                    <Box sx={{ 
                      width: 12, 
                      height: 12, 
                      borderRadius: '50%', 
                      bgcolor: 'info.main', 
                      mx: 'auto', 
                      mt: 1 
                    }} />
                  </Box>
                </Grid>

                <Grid item xs={12} md={4}>
                  <Box sx={{ textAlign: 'center', p: 2, border: 1, borderColor: 'grey.200', borderRadius: 1 }}>
                    <Typography variant="h4" color="warning.main" fontWeight="bold">
                      {systemStatus.totalSessions}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Total Sessions
                    </Typography>
                    <Box sx={{ 
                      width: 12, 
                      height: 12, 
                      borderRadius: '50%', 
                      bgcolor: 'warning.main', 
                      mx: 'auto', 
                      mt: 1 
                    }} />
                  </Box>
                </Grid>
              </Grid>

              {/* Active User Sessions */}
              <Typography variant="h6" sx={{ mb: 2 }}>
                Active User Sessions
              </Typography>
              <List sx={{ mb: 3, maxHeight: 200, overflow: 'auto' }}>
                {userSessions.length > 0 ? userSessions.slice(0, 5).map((session, index) => (
                  <ListItem key={index} sx={{ mb: 1, border: 1, borderColor: 'grey.200', borderRadius: 1 }}>
                    <ListItemIcon>
                      <Avatar sx={{ 
                        width: 32, 
                        height: 32, 
                        bgcolor: session.status === 'online' ? 'success.main' : 'grey.400' 
                      }}>
                        <Person sx={{ fontSize: 18 }} />
                      </Avatar>
                    </ListItemIcon>
                    <ListItemText 
                      primary={session.name}
                      secondary={
                        <Box>
                          <Typography variant="body2" color="text.secondary">
                            {session.email}  {session.role}
                          </Typography>
                          <Typography variant="caption" color="text.secondary">
                            {session.lastActivity}  Session: {session.sessionDuration}
                          </Typography>
                        </Box>
                      }
                    />
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                      <Box sx={{ 
                        width: 8, 
                        height: 8, 
                        borderRadius: '50%', 
                        bgcolor: session.status === 'online' ? 'success.main' : 'grey.400'
                      }} />
                      <Typography variant="caption" color={session.status === 'online' ? 'success.main' : 'text.secondary'}>
                        {session.status === 'online' ? 'Online' : 'Offline'}
                      </Typography>
                    </Box>
                  </ListItem>
                )) : (
                  <ListItem>
                    <ListItemText primary="No active sessions" secondary="All users are offline" />
                  </ListItem>
                )}
              </List>

              {/* System Metrics */}
              <Grid container spacing={3}>
                <Grid item xs={12} md={4}>
                  <Typography variant="body2" color="text.secondary">
                    Database Status
                  </Typography>
                  <Typography variant="body1" color="success.main" sx={{ mb: 2 }}>
                     Connected
                  </Typography>

                  <Typography variant="body2" color="text.secondary">
                    Last Backup
                  </Typography>
                  <Typography variant="body1" sx={{ mb: 2 }}>
                    {systemStatus.lastBackup}
                  </Typography>

                  <Typography variant="body2" color="text.secondary">
                    System Version
                  </Typography>
                  <Typography variant="body1">
                    {systemStatus.systemVersion}
                  </Typography>
                </Grid>

                <Grid item xs={12} md={4}>
                  <Typography variant="body2" color="text.secondary">
                    Server Load
                  </Typography>
                  <Typography variant="body1" color={systemStatus.serverLoad > 70 ? 'error.main' : 'success.main'} sx={{ mb: 2 }}>
                    {systemStatus.serverLoad}% {systemStatus.serverLoad > 70 ? 'High' : 'Normal'}
                  </Typography>

                  <Typography variant="body2" color="text.secondary">
                    Uptime
                  </Typography>
                  <Typography variant="body1" color="success.main">
                    {systemStatus.uptime}
                  </Typography>
                </Grid>

                <Grid item xs={12} md={4}>
                  <Typography variant="body2" color="text.secondary">
                    System Health
                  </Typography>
                  <Box sx={{ display: 'flex', alignItems: 'center', gap: 1, mb: 2 }}>
                    <Box sx={{ 
                      width: 12, 
                      height: 12, 
                      borderRadius: '50%', 
                      bgcolor: 'success.main' 
                    }} />
                    <Typography variant="body1" color="success.main">
                      All Systems Operational
                    </Typography>
                  </Box>

                  <Button variant="outlined" size="small" onClick={handleRefreshData}>
                    Refresh Status
                  </Button>
                </Grid>
              </Grid>
            </Paper>
          </>
        )}

        {/* Users Management View */}
        {currentView === 'users' && (
          <>
            <Box sx={{ mb: 3, display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
              <Typography variant="h4">User Management</Typography>
              <Button variant="contained" onClick={handleRefreshData}>
                Refresh Data
              </Button>
            </Box>
            <Paper sx={{ p: 3 }}>
              <Typography variant="h6" sx={{ mb: 2 }}>
                Total Users: {users.length}
              </Typography>
              <List>
                {users.length > 0 ? users.map((user, index) => (
                  <ListItem key={index} sx={{ mb: 1, border: 1, borderColor: 'grey.200', borderRadius: 1 }}>
                    <ListItemText 
                      primary={user.name || `User ${index + 1}`}
                      secondary={user.email || `user${index + 1}@test.com`}
                    />
                    <Button 
                      variant="outlined" 
                      color="error" 
                      onClick={() => handleDeleteUser(user.id || index)}
                    >
                      Delete
                    </Button>
                  </ListItem>
                )) : (
                  <ListItem>
                    <ListItemText primary="No users found" />
                  </ListItem>
                )}
              </List>
            </Paper>
          </>
        )}

        {/* Vendors Management View */}
        {currentView === 'vendors' && (
          <>
            <Box sx={{ mb: 3, display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
              <Typography variant="h4">Vendor Management</Typography>
              <Button variant="contained" onClick={handleRefreshData}>
                Refresh Data
              </Button>
            </Box>
            <Paper sx={{ p: 3 }}>
              <Typography variant="h6" sx={{ mb: 2 }}>
                Total Vendors: {vendors.length}
              </Typography>
              <List>
                {vendors.length > 0 ? vendors.map((vendor, index) => (
                  <ListItem key={index} sx={{ mb: 1, border: 1, borderColor: 'grey.200', borderRadius: 1 }}>
                    <ListItemText 
                      primary={vendor.name}
                      secondary={`${vendor.productCount} products`}
                    />
                    <Button 
                      variant="outlined" 
                      color="error" 
                      onClick={() => handleDeleteVendor(vendor.name)}
                    >
                      Delete
                    </Button>
                  </ListItem>
                )) : (
                  <ListItem>
                    <ListItemText primary="No vendors found" />
                  </ListItem>
                )}
              </List>
            </Paper>
          </>
        )}

        {/* Analytics View */}
        {currentView === 'analytics' && (
          <>
            <Box sx={{ mb: 3, display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
              <Typography variant="h4">Platform Analytics</Typography>
              <Button variant="contained" onClick={handleRefreshData}>
                Refresh Data
              </Button>
            </Box>
            <Grid container spacing={3}>
              <Grid item xs={12} md={6}>
                <Paper sx={{ p: 3 }}>
                  <Typography variant="h6" sx={{ mb: 2 }}>User Statistics</Typography>
                  <Typography variant="body1">Total Users: {stats.totalUsers}</Typography>
                  <Typography variant="body1">Total Vendors: {stats.totalVendors}</Typography>
                  <Typography variant="body1">Total Products: {stats.totalProducts}</Typography>
                  <Typography variant="body1">Total Orders: {stats.totalOrders}</Typography>
                </Paper>
              </Grid>
              <Grid item xs={12} md={6}>
                <Paper sx={{ p: 3 }}>
                  <Typography variant="h6" sx={{ mb: 2 }}>Revenue Analytics</Typography>
                  <Typography variant="body1">Total Revenue: NPR {stats.totalRevenue}</Typography>
                  <Typography variant="body1">Average Product Price: NPR {products.length > 0 ? Math.round(stats.totalRevenue / products.length) : 0}</Typography>
                  <Typography variant="body1">Products per Vendor: {vendors.length > 0 ? Math.round(products.length / vendors.length) : 0}</Typography>
                </Paper>
              </Grid>
            </Grid>
          </>
        )}

        {/* Settings View */}
        {currentView === 'settings' && (
          <>
            <Box sx={{ mb: 3 }}>
              <Typography variant="h4">System Settings</Typography>
            </Box>
            <Paper sx={{ p: 3 }}>
              <Typography variant="h6" sx={{ mb: 2 }}>Admin Settings</Typography>
              <Typography variant="body1" sx={{ mb: 2 }}>
                System is running normally. All admin controls are functional.
              </Typography>
              <Button variant="contained" onClick={handleRefreshData}>
                Refresh All Data
              </Button>
            </Paper>
          </>
        )}
      </Container>
    </Box>
  );
};

export default SimpleAdminDashboard;
